window.bookSummaryJSON = "<p>When magic goes wrong, who are you going to call? </p><p>The name's Torres, Bonnie Torres, and I'm a paranormal scene investigator - rooting out the truth about crimes of magic. It's dangerous and boring and scary and fascinating. Though not everyone in the Cosa Nostradamus is happy we're around, which can make things…tricky. </p><p>Working two cases - looking into a murder for the NYPD, and a rich man's break-in - should be well within our abilities. But when things start getting weird in the Electric Apple, Private Unaffiliated Paranormal Investigations is stretched to the limits, trying to keep one step ahead and out of trouble. Add in rumors of a powerful creature gunning for us and it's not just our rep on the line this time - if we don't solve this case, everyone will suffer. </p><p>Fortunately, around here, when the going gets weird, the weird hire us.…</p>"; 
